import React from 'react';
import ReactDOM from 'react-dom';
import Home from './home';
import storage from '../storage';
const text = "<<<";


class Lic extends React.Component {

  back = () => {

   ReactDOM.render(<Home />, document.getElementById('global'));
   var global = document.getElementById('global');
   global.style.background = "#ffffff";

  //console.log( this.props.dron );
  // alert( this.props.arr_info_person.length );
 }

 foo() {

   var arr_person = this.props.arr_info_person;

   var arr = arr_person.map(function(elem) {

     var lic_rah = elem.lic_rah;
     var name = elem.name;

      return ( <div class="common_user">

               <span id="lic_rah">{lic_rah}</span><br />
               <span id="name">{name}</span><br />
               <hr />
               <span id="addres">234</span>

             </div>
           )
   });

   storage.setItem("arr", arr_person);

   return arr;
 }


   render () {

     return (

         <div id="all_info_lic_rah">

           {this.foo()}

           <button onClick={this.back} id="button_back">{text}</button>

         </div>

     );
   }

}


export default Lic;
